import React from 'react';

export default function About() {
    return (
        <div className="pages container-fluid">
            <h2> About Info</h2>
            <p> I am a passionate Full Stack Web Developer with a vast array of knowledge in many different front end and back end languages, responsive frameworks, databases, and best code practices. I am dedicated and eager to continue to learn, improve and update my skill set and problem solving techniques. I look forward to continuously gaining knowledge from my peers and work collaboratively with others while being able to contribute to the technology industry.</p>
            <div className="flex-row flex-wrap">
                <div data-iframe-width="150" data-iframe-height="270" data-share-badge-id="8390eb15-79a6-4436-abca-68dfcacf5931" data-share-badge-host="https://www.credly.com"></div>

                <div data-iframe-width="150" data-iframe-height="270" data-share-badge-id="3fff4eba-e681-4c99-bfd1-7f45012f9d42" data-share-badge-host="https://www.credly.com"></div>

                <div data-iframe-width="150" data-iframe-height="270" data-share-badge-id="d55aed9a-1084-4dc8-a1b7-750f45fbae4d" data-share-badge-host="https://www.credly.com"></div>

                <div data-iframe-width="150" data-iframe-height="270" data-share-badge-id="86d00870-6146-42a1-8546-0e8ff30e69af" data-share-badge-host="https://www.credly.com"></div>

                <div> <img className="cr-standard-grid-item-content__image" src="https://images.credly.com/size/350x350/images/109b65a3-b8c5-4802-95a4-3db2f1e5ef3a/6f5fb490753026eb192a66509fe7332c.png" width="110" alt="" height="110"></img></div>

            </div>
        </div>
    );
}
